";s:17:\"Gaming Lite Child\";s:14:\"child_themeuri\";s:60:\"https://www.misbahwp.com/themes/free-gaming-wordpress-theme/\";s:15:\"child_authoruri\";s:25:\"https://www.misbahwp.com/\";s:11:\"child_descr\";s:1298:\"Gaming Lite is a responsive, modern and luxurious WordPress game theme most suitable to create game portal, gamer, gaming, magazine, tournament, news, music, game store and video game clan websites. The theme is light weight and loads smoothly without any glitches. The codes used are optimized to provide the best user experience. It is SEO-friendly theme that will assist your site to rank soon on major search engines like Google. Its responsiveness makes it mobile-friendly therefore it looks stunning on any device. It is compatible with major WordPress plugins like Contact form 7, WooCommerce, Elementor and many more. It is fully customizable with many options for customization. It is translation-ready and can be translated into many languages and also supports RTL layout. It is implemented on bootstrap framework that makes it more handy to work with. You can include shortcodes if you like from available shortcodes. WPBakery Page Builder for WordPress is included with it. With social icon widgets you can link all your social media pages to the website. It is cross-browser compatible that loads perfectly on all major browsers. To create pages there are a dozen of Gutenberg blocks and theme options. With this super gaming theme you can easily customize the website for your brand.\";s:10:\"child_tags\";s:307:\"entertainment,portfolio,e-commerce,wide-blocks,one-column,two-columns,right-sidebar,left-sidebar,grid-layout,custom-background,custom-colors,custom-header,custom-logo,custom-menu,featured-images,footer-widgets,full-width-template,editor-style,rtl-language-support,sticky-post,theme-options,threaded-comments\";s:5:\"parnt\";s:11:\"gaming-lite\";s:5:\"child\";s:17:\"gaming-lite-child\";s:10:\"configtype\";s:5:\"theme\";s:6:\"valkey\";i:1438;s:7:\"rulekey\";