(203,	74,	'description',	'Sid Meier\'s Civilization VI is a turn-based strategy 4X video game developed by Firaxis Games, published by 2K, and distributed by Take-Two Interactive. The mobile port was published by Aspyr Media. The latest entry into the Civilization series, it was released on Windows and macOS in October 2016, with later ports for Linux in February 2017, iOS in December 2017, Nintendo Switch in November 2018, PlayStation 4 and Xbox One in November 2019, and Android in 2020.'),
